import React from 'react';
import ReactDOM from 'react-dom';
const name='alka kurrey....';
const img1="http://codeskulptor-demos.commondatastorage.googleapis.com/GalaxyInvaders/alien_1_2.png";
const img2="http://codeskulptor-demos.commondatastorage.googleapis.com/GalaxyInvaders/alien_1_2.png";
const img3="http://codeskulptor-demos.commondatastorage.googleapis.com/GalaxyInvaders/alien_1_2.png";
const img4="http://codeskulptor-demos.commondatastorage.googleapis.com/GalaxyInvaders/alien_1_2.png";
ReactDOM.render(<>
  <h1> Image Gallery {name} </h1>
  <img src={img1} alt="img1" />
  <img src={img2} alt="img2" />
  <img src={img3} alt="img3" />
  <img src={img4} alt="img4" />

</>, document.getElementById('root'));
